import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';

const styles = (theme) => ({
  '@global': {
    body: {
      maxWidth: '500px',
      margin: '0px auto',
    },
  },
});

function CSSBaseline() {
  return null;
}

CSSBaseline.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(CSSBaseline);
